description:
Movie Info: Ongole Gittha is a 2013 Telugu film written and directed by Bhaskar and produced by B.V.S.N. Prasad under Sri Venkateswara Cine Chitra. The film features Ram Pothineni and Kriti Kharbanda in the lead roles. The soundtrack was be composed by G. V. Prakash Kumar, Mani Sharma also scored one song for the film and given the background score. The film was released on February 1, 2013.


